import React from "react";
import styled from "styled-components";

const Main = styled.div`
  height: 70vh;
  width: 100%;
  text-align: center;
  justify-content: space-around;
  color: white;
  background-image: url(${cnst_bg});
  background-repeat: no-repeat;
  background-position: center;
  background-size: cover;
`;
const Header = (props) => {
  return (
    <div className="row justify-content-center w-100" style={{ margin: 0 }}>
      <Main className="row">
        <div className="col" style={{ maxWidth: "50%", minWidth: 400 }}>
          <p
            style={{
              fontSize: 45,
              fontWeight: "bold",
              marginTop: "10%",
              textShadow: "3px 3px 3px #4a148c",
            }}
          >
            We build quality Homes
          </p>
          <p style={{ fontSize: 21, textShadow: "3px 3px 3px #4a148c" }}>
            100% Hassle-Free and managed by us!
          </p>
        </div>
        <Form className="col border-primary">
          <Input placeholder="Your name" type="text" />
          <Input placeholder="Your contact number" type="number" />
          <Input placeholder="Your email" type="email" />
          <Input placeholder="Your city" type="text" />
          <button
            style={{ flex: 1, margin: 20 }}
            type="submit"
            class="btn btn-primary btn-lg btn-block"
          >
            Submit
          </button>
        </Form>
      </Main>
    </div>
  );
};

export default Header;
